div.pre:
// SimpleStore allows uploading / caching raw files of any format.
type SimpleStore struct {
*uploadStore
*cacheStore
cleanup *cleanupManager
}

// List is a hostlist.List which can be passively health checked.
type List interface {
hostlist.List
Failed(addr string)
}

// Remote represents a remote build-index.
type Remote struct {
regexp *regexp.Regexp
addr string
}

// Executor executes tag replication tasks.
type Executor struct {
stats tally.Scope
originCluster blobclient.ClusterClient
tagClientProvider tagclient.Provider
}

// Store stores tags to be replicated asynchronously.
type Store struct {
db *sqlx.DB
}

// Manager defines interface for a persisted retry manager.
type Manager interface {
Add(Task) error
SyncExec(Task) error
Close()
Find(query interface{}) ([]Task, error)
}

// tagStore encapsulates two-level tag storage:
// 1. On-disk file store: persists tags for availability / write-back purposes.
// 2. Remote storage: durable tag storage.
type tagStore struct {
config Config
fs FileStore
backends *backend.Manager
writeBackManager persistedretry.Manager
}

// DependencyResolver returns a list of blob dependencies for a tag->digest mapping.
type DependencyResolver interface {
Resolve(tag string, d core.Digest) (core.DigestList, error)
}
